import React from 'react';

export default function Footer() {
    const currentYear = new Date().getFullYear();

    return (
        <footer className="bg-[#6F4E37] text-center text-orange-400 p-6">
            <div className="max-w-7xl mx-auto">
                <div className="mb-4 md:mb-0">
                    <p className="text-lg font-bold">Minha Loja</p>
                    <p className="text-sm">Seu marketplace de confiança</p>
                </div>
                <div>
                    <p className="text-sm">© {currentYear} Todos os direitos reservados.</p>
                </div>
            </div>
        </footer>
    );
}
